import styles from "../styles/Nav.module.css";

function Nav() {
    return (
        <Header>
            <div className="wrapper">
                <nav>
                    <ul>
                        <li className="./portfolio">PORTFOLIO</li>
                        <li className="./about">ABOUT</li>
                        <li className="./contact">CONTACT</li>
                    </ul>
                </nav>
            </div>
            <p className="dotted"></p>
        </Header>
    );
}

export default Nav;
